import React from 'react';
import {useSelector,useDispatch} from 'react-redux';
import InstagramIcon from '@material-ui/icons/Instagram';
import FacebookIcon from '@material-ui/icons/Facebook';
import YouTubeIcon from '@material-ui/icons/YouTube';
import CallIcon from '@material-ui/icons/Call';
import WhatsAppIcon from '@material-ui/icons/WhatsApp';
import AirlineSeatFlatIcon from '@material-ui/icons/AirlineSeatFlat';
import DirectionsRunIcon from '@material-ui/icons/DirectionsRun';
import FreeBreakfastIcon from '@material-ui/icons/FreeBreakfast';
import FastfoodIcon from '@material-ui/icons/Fastfood';
import EjectIcon from '@material-ui/icons/Eject';
import './BreakButtons.style.scss';
import Tooltip from '@material-ui/core/Tooltip';
import {startBreak} from '../../redux/breakButton/BreakButton.action';
const BreakButtons=()=>{

    const breakData=useSelector(state=>state.BreakButtonReducer);
    const dispatch=useDispatch();
    console.log('call')

    const dispatchAction=(buttonName)=>{

        dispatch(startBreak(buttonName))
    }
    return(
        <div className='breakbuttonsMainContainer'>
            <Tooltip title='Instagram'>
                <button className={`brakButton-insta-${breakData['instagram'].isActive?'active':''}`}><InstagramIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('instagram')}/></button>
            </Tooltip>
            <Tooltip title='Facebook'>
                <button className={`brakButton-fb-${breakData['faceBook'].isActive?'active':''}`}><FacebookIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('faceBook')}/></button>
            </Tooltip>

            <Tooltip title='Youtube'>
                <button className={`brakButton-youtube-${breakData['youtube'].isActive?'active':''}`}><YouTubeIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('youtube')}/></button>
            </Tooltip>

            <Tooltip title='Calls'>
                <button className={`brakButton-calls-${breakData['call'].isActive?'active':''}`}><CallIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('call')}/></button>
            </Tooltip>

            <Tooltip title='Messaging'>
                <button className={`brakButton-messaging-${breakData['messaging'].isActive?'active':''}`}><WhatsAppIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('messaging')}/></button>
            </Tooltip>


            <Tooltip title='Sleep'>
                <button className={`brakButton-sleep-${breakData['sleep'].isActive?'active':''}`}><AirlineSeatFlatIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('sleep')}/></button>
            </Tooltip>

            <Tooltip title='Excercise'>
                <button className={`brakButton-excesise-${breakData['excercise'].isActive?'active':''}`}><DirectionsRunIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('excercise')}/></button>
            </Tooltip>


            <Tooltip title='Food'>
                <button className={`brakButton-tea-${breakData['tea'].isActive?'active':''}`}><FreeBreakfastIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('food')}/></button>
            </Tooltip>


            <Tooltip title='Tea/Coffee'>
                <button className={`brakButton-food-${breakData['food'].isActive?'active':''}`}><FastfoodIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('tea')}/></button>
            </Tooltip>


            <Tooltip title='Release All'>
                 <button className={`brakButton-eject-${breakData['releaseAll'].isActive?'active':''}`}><EjectIcon style={{fill: "white"}} fontSize="large" onClick={()=>dispatchAction('releaseAll')}/></button>
            </Tooltip>


        </div>
        )
}

export default BreakButtons;
